    "2016-07-27T23:02:25.038365",nt"name": "modern-populations-migrations-demography-trophics-and-historical-status-of-the-pacific-wal",nt"isopen":
    false,nt"url": null,nt"notes": "The Pacific walrus population inhabits
    the waters over the entire continental shelf of the Bering and Chukchi seas. That
    population is a natural resource of paramount economic importance to coastal people
    of both Chukotka and Alaska, and for that reason, it has been under intensive study
    by management biologists of the Soviet Union and the United States for more than
    50 years. Much has been learned about walruses in that time, but many important
    problems still remain unsolved. The goal of this project has been to contribute
    further information on the subjects of (1) dynamics of the Pacific walrus population,
    especially from an historical aspect, (2) the current seasonal distribution and
    movements of the various parts of that population, (3) the principal kinds of foods
    eaten by the animals in different parts of their range and in different seasons
    of the year, and (4) the reactions of walruses to man-made disturbances.",nt"license_title":
